import { useContext } from "react"
import { Link } from 'react-router-dom'
import Context from "../utils/Context"

function RepoList() {
   const { userData } = useContext(Context)

   function getRepos() {
      return userData.map((e, i) => 
            <div className="w3-panel w3-border w3-round w3-large" key={i}>
               <Link to={`/repo_page/${e.name}`}>{e.name}</Link>
               <p className="w3-button w3-right w3-round w3-round-xlarge w3-grey w3-small" >{ e.private ? 'private' : 'public' }</p>
            </div>
      )
   }

   return (
      <div className="w3-content w3-container">
         <div className="w3-panel w3-border w3-round w3-grey">
            <p>banner</p>
         </div>
         { userData && getRepos() }
      </div>
   )
}

export default RepoList;
